        it("Проверка работы reuse для моделей путевых точек", function (done) {
            var model = new MultiRouteJsonModel(successRequests["Ленинский-Казанский-Кулаков (ОТ)"].result);
            eventEye.observe(model, "update");

            var oldWayPoints = model.getWayPoints().slice();
            model.setJson(successRequests["Ленинский-Якиманский-Кулаков (ОТ)"].result);
            var newWayPoints = model.getWayPoints();

            expect(eventEye.length()).to.be(1);
            expect(eventEye.prop(0, "wayPointsChange")).to.be.ok();
            expect(eventEye.prop(0, "viaPointsChange")).to.not.be.ok();
            expect(eventEye.prop(0, "routesChange")).to.not.be.ok();
            expect(oldWayPoints[0]).to.be(newWayPoints[0]);
            expect(oldWayPoints[1]).to.be(newWayPoints[1]);
            expect(oldWayPoints[2]).to.be(newWayPoints[2]);
            done();
        });

